import PropTypes from 'prop-types'

class EventPractice extends Component {
  state = {
    message: '',
  }
  render() {
    return (
      <div>
        <h1>이벤트 연습</h1>
        <input
          type="text"
          name="message"
          placeholder="input anything"
          value={this.state.message}
          onChange={e => {
            console.log(e.target.value)
          }}
        />
      </div>
    )
  }
}

export default EventPractice
